// src/components/EstampaDetalle.js
import React, { useState } from 'react';
import './EstampaDetalle.css';

const EstampaDetalle = () => {
  // Estados para cada opción
  const [selectedEstampa, setSelectedEstampa] = useState("");
  const [ubicacion, setUbicacion] = useState("");
  const [diseno, setDiseno] = useState("");
  const [color, setColor] = useState("");
  const [talla, setTalla] = useState("");
  const [cantidad, setCantidad] = useState(1);
  const [material, setMaterial] = useState("");

  return (
    <div className="detalle-contenedor">
      <div className="detalle-imagen">
        <img src="URL_DE_LA_IMAGEN" alt="Estampa de dragón" />
      </div>
      
      <div className="detalle-info">
        <h2>El dragón ardiente</h2>
        <span className="detalle-precio">$50.000</span>

        <div className="detalle-opciones">
          {/* Selección de estampa */}
          <label>Estampa:</label>
          <select value={selectedEstampa} onChange={(e) => setSelectedEstampa(e.target.value)}>
            <option value="">Ninguna</option>
            <option value="dragón">Dragón</option>
            <option value="flor">Flor</option>
            <option value="geometría">Geometría</option>
          </select>

          {/* Selección de ubicación */}
          <label>Ubicación de la estampa:</label>
          <select value={ubicacion} onChange={(e) => setUbicacion(e.target.value)}>
            <option value="central">Central</option>
            <option value="izquierda">Izquierda</option>
            <option value="derecha">Derecha</option>
          </select>

          {/* Selección de diseño predeterminado */}
          <label>Diseño predeterminado:</label>
          <select value={diseno} onChange={(e) => setDiseno(e.target.value)}>
            <option value="simple">Simple</option>
            <option value="artístico">Artístico</option>
            <option value="moderno">Moderno</option>
          </select>

          {/* Selección de color */}
          <label>Color de la camiseta:</label>
          <select value={color} onChange={(e) => setColor(e.target.value)}>
            <option value="blanco">Blanco</option>
            <option value="negro">Negro</option>
            <option value="rojo">Rojo</option>
            <option value="azul">Azul</option>
          </select>

          {/* Selección de talla */}
          <label>Talla:</label>
          <select value={talla} onChange={(e) => setTalla(e.target.value)}>
            <option value="s">S</option>
            <option value="m">M</option>
            <option value="l">L</option>
            <option value="xl">XL</option>
          </select>

          {/* Selección de cantidad */}
          <label>Cantidad:</label>
          <input
            type="number"
            value={cantidad}
            onChange={(e) => setCantidad(e.target.value)}
            min="1"
          />

          {/* Selección de material */}
          <label>Material:</label>
          <select value={material} onChange={(e) => setMaterial(e.target.value)}>
            <option value="algodón">Algodón</option>
            <option value="poliéster">Poliéster</option>
            <option value="mezcla">Mezcla Algodón-Poliéster</option>
          </select>
        </div>

        <div className="detalle-botones">
          <button className="boton-comprar">Comprar</button>
          <button className="boton-carrito">Agregar al carrito</button>
        </div>
        
        <div className="detalle-descripcion">
          <h4>Descripción del diseño</h4>
          <p>Este diseño combina la simplicidad de una camiseta con la magnificencia de un dragón, haciéndola sumamente llamativa y atractiva.</p>
        </div>
      </div>
    </div>
  );
};

export default EstampaDetalle;
